import logo from './logo.svg';
import './App.css';
import './ComponentsfirstPage/gameButtonComponent'
import ButtonsMenu from "./ComponentsfirstPage/selectGameComponent"
import'./ComponentsfirstPage/levelButtonsComponent'
import SudokuBoard from "./ComponentsSecondPage/SudokuBoardComponent";

import axios from 'axios';
import React from 'react';


class App extends React.Component {
    state = {details: [],}

    componentDidMount() {
        let data;
        axios.get('http://localhost:8000')
            .then(res => {
                data = res.data;
                this.setState({
                    details: data
                });
            })
            .catch(err => {
                "Error mounting data"
            })
    }

    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <h1>PENTRU LUMI</h1>
                    <ButtonsMenu/>
                    <SudokuBoard></SudokuBoard>
                </header>
                    <div>
                        {this.state.details.map((output, id) => (
                            <div key={id}>
                                <div>
                                    <h3>{output.row1}</h3>
                                    <h3>{output.row2}</h3>
                                    <h3>{output.row3}</h3>
                                    <h3>{output.row4}</h3>
                                    <h3>{output.row5}</h3>
                                    <h3>{output.row6}</h3>
                                    <h3>{output.row7}</h3>
                                    <h3>{output.row8}</h3>
                                    <h3>{output.row9}</h3>
                                </div>
                            </div>
                        ))}
                    </div>
            </div>
        );
    }
}

export default App;
